    //         localStorage.clear();
    //     } catch (error) {
    //         console.log(error);
    //     }
    // };


    return (
        <header>
            <h3>LOGO</h3>
            <nav ref={navRef}>
                {/* <MenuItem> */}
                <Link to="/register">Edit Profile</Link>
                <Link to="/login">Edit Profile</Link>
                {/* </MenuItem> */}
                <button
                    className="nav-btn nav-close-btn"
                    onClick={showNavbar}>
                    <FaTimes />
                </button>
            </nav>
            <button
                className="nav-btn"
                onClick={showNavbar}>
                <FaBars />
            </button>
        </header>

    );
}

export default Navbar;
